import React from "react";
import styled from "styled-components";
import { Link } from "react-router-dom";
import { PoppinsNormalGraniteGray14px, PoppinsNormalPinkSwan18px, ValignTextMiddle, PoppinsNormalWhite14px,
  PoppinsNormalEerieBlack24px, PoppinsNormalGraniteGray18px, Border1pxBlack2, PoppinsNormalBlack36px } from "../styledMixins";
import "./assets/EnterOTP";
import "./assets/styleguide";
import Header from "./pages/layout/Header";

function ValidateOtp(props) {

  const overlapGroup4 = "https://anima-uploads.s3.amazonaws.com/projects/61f1387fa60ef2351d70a102/releases/61f13d9de0abd9b62d68ae45/img/bg-card-7@1x.png";
  const Imagesrc = "https://anima-uploads.s3.amazonaws.com/projects/61f1387fa60ef2351d70a102/releases/61f139dc31e2102e5db0c9d5/img/ka-se-kitab--balbir-punj-1@2x.png";

  const className = "";
  const inputBox3Data = { inputType: "number", inputPlaceholder: "-", };

  return (
    <div className="container-center-horizontal">
      <form className="w1-a3-enter-otp screen" name="form1" action="form1" method="post">
        
      <Header/>

      <div className="OverlapGroup4" style={{ backgroundImage: `url(${overlapGroup4})` }}>
          <div className="OverlapGroup5">
            <div className="InputBox">

              <div className="HeaderText1">
                <h1 className="Title1">Otp verification</h1>
                <div className="FillText"><>enter the 4 digit otp sent on<br />xxxxxxxxx to proceed</></div>
              </div>

              <div className="GroupOtp">
                <div className="Group725">

                  <div className="OtpInputBox1">
                    <div className="OverlapGroup">
                      <InputText name="-" placeholder="-" type="text" className="ip" required />
                    </div>
                  </div>

                  <div className="OtpInputBox">
                    <div className="OverlapGroup">
                      <InputText name="-" placeholder="-" type="text" className="ip" required />
                    </div>
                  </div>

                    <div className="OtpInputBox">
                    <div className="OverlapGroup">
                      <InputText name="-" placeholder="-" type="text" className="ip" required />
                    </div>
                  </div>

                   <div className="OtpInputBox">
                    <div className="OverlapGroup">
                      <InputText name="-" placeholder="-" type="text" className="ip" required />
                    </div>
                  </div>

                </div>
              </div>

              <Link to="/auth3" className="">
                <Button src="https://anima-uploads.s3.amazonaws.com/projects/61f1387fa60ef2351d70a102/releases/61f139dc31e2102e5db0c9d5/img/button-1@2x.png" />
              </Link>

            </div>
            <img src="https://anima-uploads.s3.amazonaws.com/projects/61f1387fa60ef2351d70a102/releases/61f139dc31e2102e5db0c9d5/img/form-icons-1@2x.png" />
          </div>
          <Text>resend in 29 secs</Text>
        </div>
        <BookedCuesWillBe>booked cues will be available on cue app</BookedCuesWillBe>
      </form>
    </div>
  );
}


const InputBox2 = styled.div`
  display: flex;
  align-items: flex-start;
  min-width: 48px;

  &.input-box-1.input-box-2 {
    margin-left: 8px;
  }

  &.input-box-1.input-box-3 {
    margin-left: 8px;
  }
`;

const Text3 = styled.div`
  ${ValignTextMiddle}
  ${PoppinsNormalBlack36px}
            position: absolute;
  width: 40px;
  height: 48px;
  top: 4px;
  left: 4px;
  text-align: center;
  letter-spacing: 0;
`;


const InputText = styled.input`
  color: var(--black-2);
  font-family: var(--font-family-poppins);
  font-size: var(--font-size-xxxxxl);
  font-weight: 400;
  font-style: normal;
  position: absolute;
  width: 40px;
  height: 48px;
  top: 4px;
  left: 4px;
  background-color: transparent;
  text-align: center;
  letter-spacing: 0;
  border: 0;
  padding: 0;

  &::placeholder {
    color: #0000001f;
  }
`;

const OtpInputBox1 = styled.div`
  display: flex;
  align-items: flex-start;
  min-width: 48px;
`;

const OtpInputBox = styled.div`
  display: flex;
  align-items: flex-start;
  min-width: 48px;

  &.input-box-1.input-box-2 {
    margin-left: 8px;
  }

  &.input-box-1.input-box-3 {
    margin-left: 8px;
  }
`;

const Address = styled.p`
  ${ValignTextMiddle}
  ${PoppinsNormalWhite14px}
  flex: 1;
  width: 173px;
  text-align: center;
  letter-spacing: 0.84px;
`;

const Text = styled.div`
  ${ValignTextMiddle}
  ${PoppinsNormalGraniteGray14px}
  width: 156px;
  height: 24px;
  align-self: center;
  margin-top: 14px;
  margin-right: 12px;
  text-align: center;
  letter-spacing: 0.84px;
`;

const BookedCuesWillBe = styled.div`
  ${PoppinsNormalPinkSwan18px}
  width: 607px;
  min-height: 54px;
  margin-top: 5px;
  margin-left: 1px;
  text-align: center;
  letter-spacing: 1.08px;
  line-height: 28.6px;
`;

const Button = styled.img`
  width: 167px;
  height: 56px;
  margin-top: 40px;
  cursor: pointer;
`;


export default ValidateOtp;
